tables.table_schema:
CREATE TABLE bidding_strategy (
    strategy_id INT PRIMARY KEY,
    strategy_name VARCHAR(255) NOT NULL,
    max_cpc FLOAT NOT NULL,
    target_roas FLOAT
);

CREATE TABLE ad_group_data (
  ad_group_id INT PRIMARY KEY,
  ad_group_name VARCHAR(255) NOT NULL,
  campaign_id INT NOT NULL,
  ad_group_budget DECIMAL(10, 2) NOT NULL
);

CREATE TABLE bid_strategy_data (
  strategy_id INT PRIMARY KEY,
  strategy_name VARCHAR(255) NOT NULL,
  bid_amount DECIMAL(10, 2) NOT NULL,
  status VARCHAR(10) NOT NULL
);

CREATE TABLE ad_group (
    ad_group_id INT PRIMARY KEY,
    ad_group_name VARCHAR(255),
    campaign_id INT,
    bid_strategy VARCHAR(50)
);

CREATE TABLE user_activity (
    user_id INT PRIMARY KEY,
    username VARCHAR(50),
    action VARCHAR(50),
    timestamp TIMESTAMP
);
